description:
Fans of the Search &amp; Rescue series from InterActive Vision A/S can now fly more than a hundred missions in the UH1 &quot;Huey&quot; helicopter, through the unfriendly skies of war-torn Vietnam. As a medical evacuation pilot supporting U.S. troops in Search &amp; Rescue: Vietnam MED+EVAC, players experience realistic weather (clear, cloudy, fog, rain, or storms), authentic environments, graphics featuring dynamic lighting, vertex shading and high-res textures, and layered sound effects. Mission options include factors such as time of day (morning, midday, evening, or night), starting position (base, hovering, or mission site), and crash realism (indestructible or damage). 

